#define ReadTsc __rdtsc()

double PCFreq = 0.0;
__int64 CounterStart = 0;
__int64 cpuFreq = 0;

#define TILESIZE 1004*1004
#define SIMPIXELVALUE 32784

unsigned int simPixelData[TILESIZE+1];

void GetFrequency()
{
	LARGE_INTEGER li;
	if (!QueryPerformanceFrequency(&li))
		printf("---QueryPerformanceFrequency failed!\n");

	cpuFreq = li.QuadPart;
	PCFreq = double(li.QuadPart);
	PCFreq = double(li.QuadPart) / 1000.0f;
}

void StartCounter()
{
	LARGE_INTEGER sc;
	QueryPerformanceCounter(&sc);
	CounterStart = sc.QuadPart;
	printf("\n--Start clock ticks: %lld\n", CounterStart);
}

double GetCounter()
{
	LARGE_INTEGER ec;
	QueryPerformanceCounter(&ec);
	printf("--End clock ticks: %lld\n", ec.QuadPart);
	//printf("--Elapsed ticks: (%ld), Freq: %.2f Mhz\n", ec.QuadPart - CounterStart, PCFreq);
	printf("--Elapsed ticks: (%ld)\n", ec.QuadPart - CounterStart);
	//__int64 eticks = (ec.QuadPart - CounterStart); // * 1000000;
	//printf("--Elapsed ticks: (%ld), Elapsed usec: (%ld), Elapsed mSec: (%ld), Freq: %.2f Mhz\n", eticks, eticks/(cpuFreq/1000), eticks/cpuFreq, (double)cpuFreq/1000.0f);

	return double(ec.QuadPart - CounterStart) / PCFreq;
}

void load_simPixelData1()
{
	__m256i vpix1;

	//unsigned int *pixValue = &simPixelData[0];
	vpix1 = _mm256_set_epi32(32784, 32784, 32784, 32784, 32784, 32784, 32784, 32784);
	for(int i=0; i<TILESIZE; i+8){
		_mm256_storeu_si256((__m256i *)simPixelData[i], vpix1);
	}
}

void load_simPixelData2()
{
	__m256i vpix1;

	unsigned int* pixValue = &simPixelData[0];
	vpix1 = _mm256_set_epi32(32784, 32784, 32784, 32784, 32784, 32784, 32784, 32784);
	for (int i = 0; i < TILESIZE; i += 8) {
		_mm256_store_si256((__m256i*)pixValue, vpix1);
		pixValue+=8;
	}
}

